import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div className="container mx-auto mt-8 text-center">
      <h1 className="text-4xl font-bold mb-4">Welcome to Project Manager</h1>
      <p className="mb-4">Manage your projects and organizations efficiently.</p>
      <Link to="/register" className="bg-blue-500 text-white px-4 py-2 rounded mr-2">Get Started</Link>
      <Link to="/login" className="bg-green-500 text-white px-4 py-2 rounded">Login</Link>
    </div>
  );
};

export default Home;
